import * as React from "react";

interface Props {
  bgBtn: string | number;
  width: string | number;
  fontWeight: number | string;
  color: number | string;
  textSize: number | string;
  p: number | string;
  m: number | string;
  other?: string | number;
  children: string;
  onClick: () => string;
  icon: string;
}

export const Button = (props: Props) => {
  return (
    <button
      onClick={props.onClick}
      className={`bg-${props.bgBtn} m-${props.m}  p-${props.p} w-${props.width} font-${props.fontWeight} text-${props.color} text-${props.textSize} rounded focus:outline-none cursor-pointer`}
    >
      {props.children}
      <span>{props.icon}</span>
    </button>
  );
};
